export const getCryptoData = () => {
    const url = "https://raw.githubusercontent.com/kelkoo-services/kelisto-frontend-js-challenge-crypto/master/data/response.json"

    return fetch(url, {
        method: "GET",
        headers: {
            "User-Agent": "Juan"
        }
    })
}
